import React from 'react'

const Character = (props) => {
    const handleClick = () => {
        props.onClick(props.charactername)
    }
    return(
        <div className="character">
            <img onClick={handleClick} src={props.characterImageThumb} alt={"Profile of " + props.charactername}/>
            <h3>{props.chractername}</h3>
            <hr/>
            <p>
                {props.actorname}<br/>
                {props.housename}<br/>
            </p>
        </div>
    )
}

export default Character
